  false,\n\t\"url\": null,\n\t\"notes\": \"This is a summary of the data collected
  on Upper Des Lacs Lake as part of the State's Lake Water Quality Assessment Project.
  The Project is designed to characterize the Upper Des Lacs lake's baseline chemical,
  physical, and biological condition. The assessment is not intended to pinpoint sources
  or causes of lake condition and lacks the intensity to do so. Data was collected
  from Upper Des Lacs Lake at 2 location and on 4 discrete dates (May 21, August 12,
  September 7, 1997, and February 23, 1998.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
